import './App.css';

function App() {
  return (
    <div className="App">
      <form>
        <div class="mb-3">
          <input type="text" class="form-control"/>
        </div>
        <button type="submit" class="btn btn-primary">Add</button>
      </form>

      <div class="list">
        <p>Get Python black belt</p> 
        <input type="checkbox" class="radio"/>
        <button type="submit" class="btn btn-primary">Delete</button>
      </div>
    </div>
  );
}

export default App;
